"""### Importing librabies"""

from tensorflow.keras.layers import Input, Dense, Flatten, Lambda, Dropout
from tensorflow.keras.models import Model
from tensorflow.keras.applications.inception_v3 import InceptionV3
from tensorflow.keras.applications.inception_v3 import preprocess_input
from tensorflow.keras.preprocessing import image
from tensorflow.keras.preprocessing.image import ImageDataGenerator, load_img
from tensorflow.keras.models import Sequential
import numpy as np
from glob import glob  
import sys

# resize all images of train & test dataset
IMAGE_SIZE = [224,224]

train_path ="/content/drive/MyDrive/New Plant Diseases Dataset/train"
valid_path ="/content/drive/MyDrive/New Plant Diseases Dataset/valid"

"""##Designing Our CNN Model with help of Preâ€“Trained Model i.e., Inception v3
###Import the Inception V3 library and add preprocessing layer with weights of imagenet
### Here I am going to use all the layers in the model except for the last fully connected layer as it is specific to the ImageNet competition
"""

inception = InceptionV3(input_shape=IMAGE_SIZE + [3], weights='imagenet', include_top=False)

"""###  I am not training existing weights here that leads overfitting"""

for layer in inception.layers:
  layer.trainable=False

"""### To check the number of output classes/columns present inside the folder

"""

folders = glob("/content/drive/MyDrive/New Plant Diseases Dataset/train/*")

"""### They are 10 different classes/columns, that decides it is a multiclass classification problem and Categorical cross entropy is used here"""

folders

"""## To breif out Tomato leaves classification, Here are the 10 different types of Tomato leaves.
![image.png](data:image/png;base64,)
"""

# layers
x = Flatten()(inception.output)
x = Dense(1024, activation='relu')(x)
x = Dropout(0.2)(x)

prediction = Dense(len(folders), activation='softmax')(x)

#create a model object
model = Model(inputs=inception.input, outputs=prediction)

"""## Inception v3 Architecture for our model"""

model.summary()

"""### After creating the model,tell the model what cost and optimization method to use

"""

model.compile(loss='categorical_crossentropy',optimizer='adam',metrics=['accuracy'])

"""## Data Augumentation
### The reason to perform data augumentation as follows:
1. Training with an imbalanced dataset will result in a biased model because the dataset is not balanced and does not contain a comparable number of images for the various categories.
2. As a result, data augmentation can aid in the creation of a similar number of images in each class, resulting in reliable results


###use Image data generator to import the images from the dataset



"""

from tensorflow.keras.preprocessing.image import ImageDataGenerator

train_datagen = ImageDataGenerator(rescale=1./255,
                                   shear_range=0.2,
                                   zoom_range=0.2,
                                   height_shift_range=0.2,
                                   width_shift_range=0.2,
                                   rotation_range=40,
                                   horizontal_flip=True)

test_datagen = ImageDataGenerator(rescale = 1.0/255)

"""### Here, we need to provide same target size as initiated for the image size for both training and test set of data

"""

training_set = train_datagen.flow_from_directory('/content/drive/MyDrive/New Plant Diseases Dataset/train',
                                                 target_size=(224,224),
                                                 batch_size=32,
                                                 class_mode='categorical')

test_set = test_datagen.flow_from_directory('/content/drive/MyDrive/New Plant Diseases Dataset/valid',
                                                 target_size=(224,224),
                                                 batch_size=32,
                                                 class_mode='categorical')

"""## fit the model"""

r = model.fit_generator(
    training_set,
    validation_data=test_set,
    epochs=10,
    steps_per_epoch=len(training_set),
    validation_steps=len(test_set),
)

"""## Visualization"""

import matplotlib.pyplot as plt

"""## Training and validation Accuracy """

plt.plot(r.history['accuracy'], label='train acc')
plt.plot(r.history['val_accuracy'], label='val acc')
plt.legend()
plt.show()
plt.savefig('AccVal_acc')

"""## Training and Validation loss"""

plt.plot(r.history['loss'], label='train loss')
plt.plot(r.history['val_loss'], label='val loss')
plt.legend()
plt.show()
plt.savefig('LossVal_loss')

"""## Saving the results into drive"""

# save it as a h5 file
from tensorflow.keras.models import load_model

model.save('model_inception.h5')

